import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
			<div>
				<Link to='/'>Home</Link>
				<Link to='about'>About</Link>
				<Link to='.'></Link>
				<Link to='about'></Link>
				<Link to='about'></Link>
			</div>
		);
};

export default Home;
